import React, { Component } from 'react';

class EventPractice extends Component {
  state = { message: '' };

  render() {
    return (
      <div>
        <h1>이벤트 연습</h1>
        <input
          type="text"
          name="massage"
          placeholder="아무거나 입력해"
          value={this.state.massage}
          onChange={(e) => console.log(e.target.value)}
        />
      </div>
    );
  }
}

export default EventPractice;
